import React from 'react';
import {Drawer, AppBar, Toolbar} from '@material-ui/core';
import {makeStyles, Typography } from '@material-ui/core';
import {List, ListItem, ListItemIcon, ListItemText} from '@material-ui/core';
import {NavBarItems} from './NavBarItems';
import { HomeRounded, SchoolRounded } from '@material-ui/icons';

const drawerWidth = "250px"

export const styles = makeStyles((theme) => ({
    page: {
        background: "light grey",
        width: "100%"
    },

    drawer: {
        width: drawerWidth,
    },

    paper: {
        width: drawerWidth
    },

    root: {
        display:"flex"
    },

    icons:{
        flex: "30%",
        display: "grid",
        placeItems: "center",
    },

    titles:{
        flex: "70%",
        fontFamily: "Noto Sans, sans-serif"
    },

    logo:{
        paddingLeft: "40px",
        paddingTop: "10px"

    },

    toolbar: theme.mixins.toolbar,

    content: {
        flexGrow: "1",
        backgroundColor: "theme.palette.background.default",
        padding: "theme.spacing(3)",
    },
}))

function NavBar() {
    const classes = styles();

    return (
        <div className={classes.root}>
            <AppBar>
                <Toolbar colour="secondary">

                </Toolbar>
            </AppBar>

            <Drawer
            className={classes.drawer}
            variant="permanent"
            anchor='left'
            classes={{paper: classes.paper}}
            >
                <div>                
                    <Typography variant='h4'>
                        <SchoolRounded color="gray"/>
                    </Typography>
                </div>
                <div className={classes.toolbar}/>
                <List >
                {NavBarItems.map((val, key) => (
                        <ListItem button key={key}>
                            <ListItemIcon className={classes.icons}>{val.icon}</ListItemIcon>
                            <ListItemText className={classes.titles} primary={val.title}/>
                        </ListItem>
                    ))}

                </List>

            </Drawer>
        </div>
    )
}

export default NavBar
